import React from 'react';
import { Typography } from '@material-ui/core';
import { Button } from '@material-ui/core';
import {Grid} from '@material-ui/core';

const Experience = () => {
    return (
        <Grid container
        direction="row"
        justify="flex-start"
        alignItems="center"
        style={{marginLeft:'30px'}}>
            <Grid item xs={12}>
            <Typography
                display="block"
                justifyContent="center"
                align="left"
                variant="h4"
                style={{opacity:'100%', fontWeight:'bold', fontSize:'40px', color:'white', marginBottom:'20px'}}>
                    Experience
                </Typography>
            </Grid>
        </Grid>
    )
}

export default Experience;
